INSERT INTO `taxonSource` (`taxonSourceID`, `taxonSource`, `citation`) VALUES
(1, 'ACCS Non-native List', 'AKEPIC. 2020. Alaska Exotic Plant Information Clearinghouse Non-native Species List. Alaska Center for Conservation Science, University of Alaska Anchorage. Anchorage, Alaska. Available: <a target=\'_blank\' href=\'https://accs.uaa.alaska.edu/invasive-species/non-native-plant-species-list/\'>https://accs.uaa.alaska.edu/invasive-species/non-native-plant-species-list/</a>'),
