(3, 'Adhikari and Wallace 2014', 'Adhikari, B., and L.E. Wallace. 2014. Does the <i>Platanthera dilatata</i> (Orchidaceae) complex contain cryptic species or continuously variable populations? Plant Systematics and Evolution. 300:1465-1476.'),
