(5, 'Almeida et al. 2016', 'Almeida, T.E., S. Hennequin, H. Schneider, A.R. Smith, J.A.N. Batista, A.J. Ramalho, K. Proite, and A. Salino. 2016. Towards a phylogenetic generic classification of Thelypteridaceae: Additional sampling suggests alterations of neotropical taxa and further study of paleotropical genera. Molecular Phylogenetics and Evolution. 94:688-700.'),
